                        Description: <input type="text" name="description" /><br/>
                        Picture URL: <input type="text" name="imageURL" /><br/>
                        Price: <input type="number" min={0.05} step={.01} name="price" /><br/>
                        Quantity: <input type="number" min={1} name="quantity" /><br/>
